class Solution {
  int stringCount(int n) {
    const int mod = 1000000007;
    if (n < 4) return 0;
    List<int> factorial = List.filled(n + 1, 0);
    factorial[0] = 1;
    for (int i = 1; i <= n; i++) {
      factorial[i] = (factorial[i - 1] * i) % mod;
    }
    int count = factorial[n];
    for (int i = 1; i <= n - 4; i++) {
      count = (count + (factorial[n] - factorial[i] * factorial[n - 4] % mod + mod) % mod) % mod;
    }
    return count;
  }
}
